from PIL import Image, ImageDraw, ImageFont, ImageFilter
import sys
import os

archivonarrowb64 = ""

def help():
    print("Usage: brat.py [text] [outputimg] [fontsize 73]")
    sys.exit()
if len(sys.argv) <= 2:
    help()
if len(sys.argv) > 4:
    help()

if len(sys.argv) == 4:
    try:
        textsize = int(sys.argv[3])
    except:
        print("Font Size should be a number")
        sys.exit()
else:
    textsize = 73

if not os.path.exists("ArchivoNarrow-Regular.ttf"):
    import base64
    with open("ArchivoNarrow-Regular.ttf", "wb") as fontfile:
        print("Writing font file")
        fontfile.write(base64.b64decode(archivonarrowb64))

archivoNarrow = ImageFont.truetype("ArchivoNarrow-Regular.ttf", textsize)

sizeW, sizeH = (225,225)
outputImg = Image.new("RGB", (sizeW, sizeH))
drawImg = ImageDraw.Draw(outputImg)

outputName = sys.argv[2]
text = sys.argv[1]

# fill up with matcha
outputImg.paste((138, 206, 0), (0, 0, outputImg.width, outputImg.height))

drawImg.text((outputImg.width // 2, outputImg.height // 2), text, (0,0,0), archivoNarrow, anchor="mm")
blurred = outputImg.filter(ImageFilter.BoxBlur(2))

blurred.show()
blurred.save(outputName)
